import React from "react";

const About=()=>{
    return(
        <>
            <div className="container">
                <div className="row">
                    <div col-10>
                        <img src="https://picsum.photos/200/300"/>
                    </div>
                </div>
            </div>
        </>
    );
}

export default About;
